import { produce } from 'immer';

const INITIAL_STATE = {
  profile: false,
  loading: false,
};

export default function deliveryman(state = INITIAL_STATE, action) {
  return produce(state, draft => {
    switch (action.type) {
      case '@deliverman/EDIT_REQUEST':
        {
          draft.loading = true;
          break;
        }
        defaultl;
    }
  });
}
